import React from "react";
import Contacts from "../contacts.js";
import Card from "./Card";
var con = Contacts;

function App() {
  return (
    <Card
      name={con[0].name}
      phone={con[0].phone}
      img={con[0].imgURL}
      email={con[0].email}
    />
  );
}

export default App;
